        // Ajouter un événement de clic sur le widget
        activite1.onClick = function(event) {
            // Cacher le widget lorsqu'il est cliqué
            activite1.hide()
        }
    } else {
        // Afficher un message d'erreur dans la console
        console.error('Widget Activite1 non trouvé')
    }
} else {
    // Afficher un message d'erreur dans la console
    console.error('Écran ListeActivite non trouvé')
}

